CREATE TABLE grid (
    id integer NOT NULL,
    geom geometry(PointZ,4326),
    scale double precision NOT NULL,
    scale_non_uniform double precision[],
    yaw numeric NOT NULL,
    pitch numeric NOT NULL,
    roll numeric NOT NULL,
    model character varying NOT NULL,
    tags json
);
ALTER TABLE ONLY grid
    ADD CONSTRAINT grid_pkey PRIMARY KEY (id);
CREATE INDEX idx_grid_geom ON grid USING gist (geom);


